import React from 'react';
import './Button.css';

class Button extends React.Component {
  clicked() {
    console.log("Hi Button!");
  }
  render() {
    const {
      title = title
    } = this.props
    return (
      <button title={title} className='button' onClick={this.clicked}/>
    );
  }
}

export default Button;
